# Use a set for efficient lookup
ACCEPTED_IDS_SET = set(GOOD_RESULTS['rejected'])

def filter_folders(target_dir, dry_run=True, auto_confirm=False):
    """
    Filters folders in target_dir based on ACCEPTED_IDS_SET.
    Deletes folders whose base OpenReview ID is not in the accepted list.
    """
    if not os.path.isdir(target_dir):
        print(f"Error: Target directory '{target_dir}' not found or is not a directory.")
        return

    folders_to_delete = []
    folders_to_keep = []
    
    print(f"\nScanning directory: {os.path.abspath(target_dir)}")
    print(f"Found {len(ACCEPTED_IDS_SET)} accepted OpenReview IDs in the list.")

    for entry_name in os.listdir(target_dir):
        full_path = os.path.join(target_dir, entry_name)
        if os.path.isdir(full_path):
            # Extract OpenReview ID (part before the first underscore)
            try:
                openreview_id_part = entry_name.split('_')[0]
            except IndexError:
                print(f"Warning: Could not parse OpenReview ID from folder name '{entry_name}'. Skipping.")
                folders_to_keep.append(full_path) # Keep if format is unexpected
                continue

            if openreview_id_part in ACCEPTED_IDS_SET:
                folders_to_keep.append(full_path)
            else:
                folders_to_delete.append(full_path)
    
    print(f"\nScan complete.")
    print(f" - Folders to keep (ID in accepted list or unparsable): {len(folders_to_keep)}")
    print(f" - Folders to delete (ID NOT in accepted list): {len(folders_to_delete)}")

    if not folders_to_delete:
        print("\nNo folders to delete.")
        return

    print("\nFolders that would be DELETED:")
    for folder_path in folders_to_delete:
        print(f"  - {folder_path} (ID: {os.path.basename(folder_path).split('_')[0]})")

    if dry_run:
        print("\n--- DRY RUN active. No files will be deleted. ---")
        print("Run without --dry-run to enable deletion.")
        return

    if not auto_confirm:
        confirm = input(f"\nProceed with deleting {len(folders_to_delete)} folder(s)? (yes/no): ").strip().lower()
        if confirm != 'yes':
            print("Deletion cancelled by user.")
            return
    
    print("\n--- DELETING FOLDERS ---")
    deleted_count = 0
    error_count = 0
    for folder_path in folders_to_delete:
        try:
            shutil.rmtree(folder_path)
            print(f"Successfully deleted: {folder_path}")
            deleted_count += 1
        except Exception as e:
            print(f"Error deleting folder {folder_path}: {e}")
            error_count += 1
            
    print("\n--- Deletion Summary ---")
    print(f"Successfully deleted: {deleted_count} folder(s)")
    if error_count > 0:
        print(f"Failed to delete: {error_count} folder(s)")


if __name__ == "__main__":
    parser = argparse.ArgumentParser(
        description="Filter and delete folders not in the accepted OpenReview ID list.",
        formatter_class=argparse.RawTextHelpFormatter
    )
    parser.add_argument(
        "target_dir",
        help="The directory to scan for folders (e.g., './accepted_papers/')."
    )
    parser.add_argument(
        "--dry-run",
        action="store_true",
        help="Show which folders would be deleted without actually deleting them."
    )
    parser.add_argument(
        "--yes",
        "-y",
        action="store_true",
        help="Automatically confirm deletion (use with caution!)."
    )

    args = parser.parse_args()

    filter_folders(args.target_dir, args.dry_run, args.yes)